import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Index from "./components/Home";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="" element={<Home />} />
        <Route path="admin">
          <Route path="user">
            <Route path="list" />
          </Route>
          <Route path="product">
            <Route path="list" />
          </Route>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
